import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HomePage from './pages/HomePage';
import BuildStackPage from './pages/BuildStackPage';
import RunStackPage from './pages/RunStackPage';
import StacksPage from './pages/StacksPage';
import StackDefaultPage from './pages/StackDefaultPage';


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={HomePage} />
       
        <Route path="/stack-default" component={StackDefaultPage} />
        <Route path="/build-stack" component={BuildStackPage} />
        <Route path="/run-stack" component={RunStackPage} />
        <Route path="/stacks" component={StacksPage} />
      </Switch>
    </Router>
  );
}

export default App;
